const styles = {
  root: {
    flexGrow: 1,
    width: "100%",
    height: "auto",
    overflow: "hidden",
  },
  appBar: {
    backgroundColor: "#1a1a1a",
    color: "#ffffff",
    overflow: "hidden",
    width: "auto", // чтобы не растягивался за пределы контента
  },
  toolbar: {
    display: "flex",
    justifyContent: "space-between",
    width: "auto", // чтобы не растягивался за пределы контента
    overflow: "hidden",
  },
  leftItems: {
    display: "flex",
    alignItems: "center",
    width: "auto", // ограничиваем ширину контейнера
  },
  centerItems: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    width: "auto", // ограничиваем ширину контейнера
  },
  rightItems: {
    display: "flex",
    alignItems: "center",
    width: "auto", // ограничиваем ширину контейнера
  },
  menuButton: {
    marginRight: 10,
    overflow: "hidden",
  },
  menuItem: {
    color: "#ffffff",
    transition: "color 0.3s",
  },
  icon: {
    width: "auto",
    height: 40,
    marginRight: 10,
    overflow: "hidden",
  },
  drawerList: {
    width: 250,
    backgroundColor: "transparent", // Убираем белый фон
    padding: 0, // Убираем отступы для списка
    transition: "background-color 0.3s ease",
  },
  drawerHeader: {
    display: "flex",
    justifyContent: "flex-end",
    padding: "10px",
  },
  closeButton: {
    color: "#000",
    transition: "color 0.3s",
  },
  drawer: {
    backgroundColor: "rgba(0, 0, 0, 0.8)", // Оставляем прозрачный фон
    transition: "background-color 0.3s ease", // Плавная анимация фона
    padding: 0, // Убираем лишние отступы
  },
};
